      // Check balance of token ID 15
      const balance = await contract.balanceOf(userAddress, 15);
      if (balance.gt(0)) {
        console.log("You already own this NFT!");
        runtimeScene.getGame().getVariables().get("NFT_Secret_Pika").setBoolean(true);
        return;
      }
      
      // Get current mint price
      const mintPrice = await contract.mintPrice();
      console.log("Current mint price:", ethers.utils.formatEther(mintPrice), "ETH");
      
      // Mint token with required payment
      console.log("Attempting to mint token ID 15...");
      const tx = await contract.mint(
        15, // Token ID
        1, // Amount to mint
        { value: mintPrice } // Send the required ETH
      );
      
      console.log("Mint transaction sent:", tx.hash);
const receipt = await tx.wait();
console.log("Transaction confirmed! Block number:", receipt.blockNumber);
runtimeScene.getGame().getVariables().get("NFT_Secret_Pika").setBoolean(true);
